import { CircularProgress, Stack } from '@material-ui/core'

import React from 'react'

function CustomSpinner() {
  return (
    <div sx={{ display: 'flex' }}>
      <Stack sx={{ color: 'grey.500' }}>
        <CircularProgress color='success' />
      </Stack>
    </div>
  )
}

export default CustomSpinner
